               io_Dshaped
);

  reg  [2:0] Areg;
  reg  [2:0] Breg;
  reg  [2:0] Creg;
  reg  [2:0] Dreg;
  wire [5:0] _io_Ashaped_T_1 = {{3{io_A[2]}}, io_A} * 6'h3 + {{3{Areg[2]}}, Areg};
  wire [5:0] _io_Bshaped_T_1 = {{3{io_B[2]}}, io_B} * 6'h3 + {{3{Breg[2]}}, Breg};
  wire [5:0] _io_Cshaped_T_1 = {{3{io_C[2]}}, io_C} * 6'h3 + {{3{Creg[2]}}, Creg};
  wire [5:0] _io_Dshaped_T_1 = {{3{io_D[2]}}, io_D} * 6'h3 + {{3{Dreg[2]}}, Dreg};
