    if (reset) begin
      Areg <= 3'h0;
      Breg <= 3'h0;
      Creg <= 3'h0;
      Dreg <= 3'h0;
    end
    else begin
      Areg <= io_A;
      Breg <= io_B;
      Creg <= io_C;
      Dreg <= io_D;
    end
  end // always @(posedge)
  assign io_Ashaped = {_io_Ashaped_T_1[5], _io_Ashaped_T_1};
  assign io_Bshaped = {_io_Bshaped_T_1[5], _io_Bshaped_T_1};
  assign io_Cshaped = {_io_Cshaped_T_1[5], _io_Cshaped_T_1};
